import React from "react";
import Link from "next/link";

import { Menu, Button } from "antd";
import {
  HomeOutlined,
  AppstoreOutlined,
  SettingOutlined,
  SmileOutlined
} from "@ant-design/icons";
import renderEmpty from "antd/lib/config-provider/renderEmpty";
const { SubMenu } = Menu;

const Nav = ({ categories }) => {
  state = {
    current: "mail"
  };

  handleClick = (e) => {
    console.log("click ", e);
    this.setState({ current: e.key });
  };

  return (
    <Menu mode="horizontal">
      <Menu.Item key="home" icon={<HomeOutlined />}>
        <Link href="/">
          <a>Home</a>
        </Link>
      </Menu.Item>
      <Menu.Item key="about" icon={<SmileOutlined />}>
        <Link href="/about">
          <a>About</a>
        </Link>
      </Menu.Item>
      <SubMenu key="SubMenu" icon={<SettingOutlined />} title="Categories">
        {categories.map((category) => {
          return (
            // <li key={category.id}>
            <Menu.Item key={category.id}>
              <Link as={`/category/${category.id}`} href="/category/[id]">
                <a>{category.name}</a>
              </Link>
            </Menu.Item>
          );
        })}
      </SubMenu>
    </Menu>
  );
};

export default Nav;

